INSERT INTO `kk_language_variant` (`id`, `name`, `subtag`, `prefixes`, `comment`) VALUES (1,'Late Middle French (to 1606)','1606nict','frm','16th century French as in Jean Nicot, \"Thresor de la languefrancoyse\", 1606, but also including some French similar to that ofRabelais'),(2,'Early Modern French','1694acad','fr','17th century French, as catalogued in the \"Dictionnaire del\'académie françoise\", 4eme ed. 1694; frequently includeselements of Middle French, as this is a transitional period'),(3,'Traditional German orthography','1901','de',NULL),(4,'\"Academic\" (\"governmental\") variant of Belarusian ascodified in 1959','1959acad','be',NULL),(5,'Standardized Resian orthography','1994','sl-rozaj,sl-rozaj-biske,sl-rozaj-njiva,sl-rozaj-osojs,sl-rozaj-solba','For standardized Resian an orthography was published in 1994.'),(6,'German orthography of 1996','1996','de',NULL),(7,'Orthographic formulation of 1943 - Official in Brazil(Formulário Ortográfico de 1943 - Oficial no Brasil)','abl1943','pt-BR','Denotes conventions established by the Academia Brasileira deLetras in 1943 and generally used in Brazil until 2009'),(8,'ALA-LC Romanization, 1997 edition','alalc97',NULL,'Romanizations recommended by the American Library Associationand the Library of Congress, in \"ALA-LC Romanization Tables:Transliteration Schemes for Non-Roman Scripts\" (1997), ISBN978-0-8444-0940-5.'),(9,'Aluku dialect','aluku','djk','Aluku dialect of the \"Busi Nenge Tongo\" English-based Creolecontinuum in Eastern Suriname and Western French Guiana'),(10,'Portuguese Language Orthographic Agreement of 1990 (AcordoOrtográfico da Língua Portuguesa de 1990)','ao1990','pt,gl','Portuguese orthography conventions established in 1990 butnot brought into effect until 2009'),(11,'Eastern Armenian','arevela','hy',NULL),(12,'Western Armenian','arevmda','hy',NULL),(13,'Unified Turkic Latin Alphabet (Historical)','baku1926','az,ba,crh,kk,krc,ky,sah,tk,tt,uz','Denotes alphabet used in Turkic republics/regions of theformer USSR in late 1920s, and throughout 1930s, which aspired torepresent equivalent phonemes in a unified fashion. Also known as: NewTurkic Alphabet; Birlәşdirilmiş Jeni TyrkӘlifbasь (Birlesdirilmis Jeni Tyrk Elifbasi);Jaŋalif (Janalif).'),(14,'The Balanka dialect of Anii','balanka','blo','Balanka is one of 19 Anii dialects.'),(15,'The Barlavento dialect group of Kabuverdianu','barla','kea','Barlavento is one of the two main dialect groups ofKabuverdianu.'),(16,'Basic English','basiceng','en',NULL),(17,'Buddhist Hybrid Sanskrit','bauddha','sa',NULL),(18,'Biscayan dialect of Basque','biscayan','eu',NULL),(19,'The San Giorgio dialect of Resian','biske','sl-rozaj','The dialect of San Giorgio/Bila is one of the four major localdialects of Resian'),(20,'Slovene in Bohorič alphabet','bohoric','sl','The subtag represents the alphabet codified by Adam Bohoričin 1584 and used from the first printed Slovene book and up to themid-19th century.'),(21,'Boontling','boont','en','Jargon embedded in American English'),(22,'Portuguese-Brazilian Orthographic Convention of 1945(Convenção Ortográfica Luso-Brasileira de 1945)','colb1945','pt','Portuguese orthography conventions established in 1945,generally in effect until 2009. This reform was not ratified inBrazil.'),(23,'Cornu-English','cornu','en',NULL),(24,'Slovene in Dajnko alphabet','dajnko','sl','The subtag represents the alphabet codified by Peter Dajnkoand used from 1824 to 1839 mostly in Styria (in what is now EasternSlovenia).'),(25,'Serbian with Ekavian pronunciation','ekavsk','sr,sr-Latn,sr-Cyrl',NULL),(26,'Early Modern English (1500-1700)','emodeng','en',NULL),(27,'International Phonetic Alphabet','fonipa',NULL,NULL),(28,'Uralic Phonetic Alphabet','fonupa',NULL,NULL),(29,'X-SAMPA transcription','fonxsamp',NULL,'Indicates that the content is transcribed according to X-SAMPA'),(30,'Hepburn romanization','hepburn','ja-Latn',NULL),(31,'Hepburn romanization, Library of Congress method','heploc','ja-Latn-hepburn','Preferr